import React from 'react';
import './css/Contact.css';

class Contact extends React.Component {
  render () {
    return (
      <div className="contact-container">
        <h1 ref={this.props.reference} className="contact-header">Contact</h1>
        
      </div>
    )
  }
}

export default Contact;
